import {BrowserRouter as Router, Route, Switch} from 'react-router-dom';
import TreeOnTreeGame from './TreeOnTreeGame';


const Body = () => {
    return ( 
        <Router>
            <div>
                <div className="row">
                    <Switch>
                        <Route exact path="/treeontreegame">
                            <div className="col">
                                <button>{< TreeOnTreeGame />} xxx</button>
                            </div>
                        </Route>

                        <div className="col">
                            <button>4x4</button>
                        </div>

                        <div className="col">
                            <button>5x5</button>
                        </div>

                    </Switch>
                </div>
            </div>
        </Router>
     );
}

export default Body;
